import { useState } from 'react'
import Shelter from '../../desingImgs/shelter.jpg'
import Shelter1 from '../../desingImgs/Image.png'
import { Img, Container } from './desingsStyles'

const Designs = () => {
    const [photos, setPhotos] = useState([Shelter, Shelter1])
    const [selectedPhoto, setSelectedPhoto] = useState()
    
    const activatePhoto = photo => {
        setSelectedPhoto(photo)
    }
    
    return (
        <Container>
            {
                photos && photos.map(p => (
                    <Img src={p} onClick={() => activatePhoto(p)} />
                ))
            }
        </Container>
    )
}

export default Designs
